import db from './db.json';

const results = db.results;
const user = {
  name: 'Oleg Vasyl',
  age: 18,
};

function App() {
  return (
    <div className="App">
      <p>{user.age > 16 ? 'Hello)' : 'By('}</p>
      <>{Product(results)}</>
      <span>some text</span>
      <label htmlFor="input-form">Kababra</label>
      <input id="input-form" placeholder="do text" />
    </div>
  );
}

const Product = (props) =>
  props.map((item) => {
    <div>
      <h2>{item.name}</h2>
    </div>;
  });

export default App;
